import React from 'react'
import { Spring, animated } from 'react-spring/renderprops.cjs'
import PortfolioElement from './portfolio-element'

const images = {
    avciso_images: [
        {
        original: "api/images/avciso-1.png",
        description: `AvCISO`
        },
        {
        original: "api/images/avciso-2.png",
        description: `AvCISO`
        },
        {
        original: "api/images/avciso-3.png",
        description: `AvCISO`
        }
    ],
    public_ballot: [
        {
            original: "api/images/publicballot-1.png",
            description: `PublicBallot.org`
        },
        {
            original: "api/images/publicballot-2.png",
            description: `PublicBallot.org`
        },
        {
            original: "api/images/publicballot-3.png",
            description: `PublicBallot.org`
        }
    ],
    software_dev: [
        {
            original: "api/images/3444-2.png",
            description: `Point of Service Project`
        },
        {
            original: "api/images/3444-1.png",
            description: `Point of Service Project`
        },
        {
            original: "api/images/3444-3.png",
            description: `Point of Service Project`
        }
    ]
}


class PortfolioProjects extends React.Component {

    constructor(props) {
        super(props)
        this.state = {
            theComeUp: 0,
            project: ''
        }
        console.log("LKFJSLDKFJ")
    }

    open_window = (project) => {
        console.log("HEY")
        this.setState({
            project: project,
            theComeUp: 1
        })
    }

    close_window = () => {
        this.setState({
            theComeUp: 0
        })
    }

    render() {
        return (
            <Spring
                toggle={this.state.theComeUp}
                from={{
                    opacity: 0, 
                    transform: 'translate3d(0,40px,0)',
                    display: 'none'
                }}
                to={{
                    display: this.state.theComeUp ? "" : 'none', 
                    opacity: this.state.theComeUp ? 1 : 0, 
                    transform: this.state.theComeUp ? 'translate3d(0,40px,0)' : 'translate3d(0,0,0)'
                }}>
                {({ opacity, transform, display}) => 
                        <animated.div id='fullscreen' style={{opacity, transform, display, zIndex: 3, position: 'absolute', width: '100%', backgroundColor: '#80808070', zIndex: '10'}}>
                            <PortfolioElement images={images[this.props.option]} />
                        </animated.div>
                }
            </Spring>
        )
    }
}

export default PortfolioProjects;
